import React, { useState } from 'react';

interface Transaction {
  id: number;
  transactionType: string;
  amount: number;
  currency: string;
  description: string;
  transactionDate: string;
  status: string;
  referenceNumber: string;
}

const Transactions: React.FC = () => {
  // 仮のユーザーID（現在は使用していない）
  // const [userId] = useState(2);
  const [selectedAccount, setSelectedAccount] = useState<number | null>(null);

  // 認証チェックを無効化 - モックデータを使用
  const mockTransactions = [
    {
      id: 1,
      transactionType: 'TRANSFER',
      amount: 50000,
      currency: 'JPY',
      description: '給料振込',
      transactionDate: new Date().toISOString(),
      status: 'COMPLETED',
      referenceNumber: 'TXN001'
    },
    {
      id: 2,
      transactionType: 'TRANSFER',
      amount: 25000,
      currency: 'JPY',
      description: '家賃支払い',
      transactionDate: new Date(Date.now() - 86400000).toISOString(),
      status: 'COMPLETED',
      referenceNumber: 'TXN002'
    },
    {
      id: 3,
      transactionType: 'DEPOSIT',
      amount: 100000,
      currency: 'JPY',
      description: '現金入金',
      transactionDate: new Date(Date.now() - 172800000).toISOString(),
      status: 'COMPLETED',
      referenceNumber: 'TXN003'
    }
  ];

  const transactions = mockTransactions;
  const isLoading = false;
  const error = null;

  const getTransactionTypeLabel = (type: string) => {
    switch (type) {
      case 'TRANSFER':
        return '振込';
      case 'DEPOSIT':
        return '入金';
      case 'WITHDRAWAL':
        return '出金';
      case 'PAYMENT':
        return '支払い';
      default:
        return type;
    }
  };

  const getStatusLabel = (status: string) => {
    switch (status) {
      case 'COMPLETED':
        return '完了';
      case 'PENDING':
        return '処理中';
      case 'FAILED':
        return '失敗';
      case 'CANCELLED':
        return 'キャンセル';
      default:
        return status;
    }
  };

  if (isLoading) {
    return (
      <div className="flex justify-center items-center h-64">
        <div className="text-lg">読み込み中...</div>
      </div>
    );
  }

  if (error) {
    return (
      <div className="text-center">
        <div className="text-red-600">エラーが発生しました</div>
      </div>
    );
  }

  return (
    <div className="space-y-6">
      <div>
        <h1 className="text-3xl font-bold text-gray-900">取引履歴</h1>
        <p className="text-gray-600">お客様の取引履歴をご確認いただけます。</p>
      </div>

      {/* 口座選択 */}
      <div className="bg-white shadow rounded-lg p-4">
        <label htmlFor="account-select" className="block text-sm font-medium text-gray-700 mb-2">
          口座を選択
        </label>
        <select
          id="account-select"
          value={selectedAccount || ''}
          onChange={(e) => setSelectedAccount(e.target.value ? Number(e.target.value) : null)}
          className="block w-full px-3 py-2 border border-gray-300 rounded-md shadow-sm focus:outline-none focus:ring-primary-500 focus:border-primary-500"
        >
          <option value="">すべての口座</option>
          <option value="1">普通預金口座 (1234-5678)</option>
          <option value="2">定期預金口座 (8765-4321)</option>
        </select>
      </div>

      <div className="bg-white shadow overflow-hidden sm:rounded-md">
        <div className="px-4 py-5 sm:px-6">
          <h3 className="text-lg leading-6 font-medium text-gray-900">
            取引一覧
          </h3>
        </div>
        <ul className="divide-y divide-gray-200">
          {transactions?.map((transaction: Transaction) => (
            <li key={transaction.id}>
              <div className="px-4 py-4 sm:px-6">
                <div className="flex items-center justify-between">
                  <div className="flex items-center">
                    <div className="flex-shrink-0">
                      <div className={`h-10 w-10 rounded-full flex items-center justify-center ${
                        transaction.transactionType === 'TRANSFER' ? 'bg-blue-100' :
                        transaction.transactionType === 'DEPOSIT' ? 'bg-green-100' :
                        transaction.transactionType === 'WITHDRAWAL' ? 'bg-red-100' :
                        'bg-gray-100'
                      }`}>
                        <span className={`text-sm font-medium ${
                          transaction.transactionType === 'TRANSFER' ? 'text-blue-600' :
                          transaction.transactionType === 'DEPOSIT' ? 'text-green-600' :
                          transaction.transactionType === 'WITHDRAWAL' ? 'text-red-600' :
                          'text-gray-600'
                        }`}>
                          {getTransactionTypeLabel(transaction.transactionType).charAt(0)}
                        </span>
                      </div>
                    </div>
                    <div className="ml-4 flex-1">
                      <div className="flex items-center justify-between">
                        <div>
                          <div className="text-sm font-medium text-gray-900">
                            {transaction.description}
                          </div>
                          <div className="text-sm text-gray-500">
                            {getTransactionTypeLabel(transaction.transactionType)}
                          </div>
                          <div className="text-xs text-gray-400">
                            取引番号: {transaction.referenceNumber}
                          </div>
                        </div>
                        <div className="text-right">
                          <div className={`text-sm font-medium ${
                            transaction.transactionType === 'DEPOSIT' ? 'text-green-600' : 'text-red-600'
                          }`}>
                            {transaction.transactionType === 'DEPOSIT' ? '+' : '-'}¥{transaction.amount.toLocaleString()}
                          </div>
                          <div className="text-sm text-gray-500">
                            {transaction.currency}
                          </div>
                          <div className={`inline-flex px-2 py-1 text-xs font-semibold rounded-full ${
                            transaction.status === 'COMPLETED' ? 'bg-green-100 text-green-800' :
                            transaction.status === 'PENDING' ? 'bg-yellow-100 text-yellow-800' :
                            transaction.status === 'FAILED' ? 'bg-red-100 text-red-800' :
                            'bg-gray-100 text-gray-800'
                          }`}>
                            {getStatusLabel(transaction.status)}
                          </div>
                        </div>
                      </div>
                      <div className="mt-2 text-xs text-gray-400">
                        {new Date(transaction.transactionDate).toLocaleString('ja-JP')}
                      </div>
                    </div>
                  </div>
                </div>
              </div>
            </li>
          ))}
        </ul>
      </div>

      {transactions?.length === 0 && (
        <div className="text-center py-12">
          <div className="text-gray-500">取引履歴がありません</div>
        </div>
      )}
    </div>
  );
};

export default Transactions;
